  \"2016-03-17T20:51:41.550806\",\n\t\"name\": \"workforce-training-program-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Iowa Economic Development Authority
  (IEDA) is charged by the Iowa General Assembly with coordinating the following four
  training programs that fuel growth and competitiveness in Iowau2019s economy by
  delivering customized training to support a skilled workforce for Iowa business:nn1.
  \    Industrial New Jobs Training Act u2013 260E n2.     Iowa Jobs Training Act
  u2013 260F n3.     Accelerated Career Education Program Act u2013 260G n4.     Apprenticeship
  Training Act u2013 15B nnIEDA is responsible for administering these programs on
  behalf of the State of Iowa by ensuring conformance with statutory and administrative
  rule provisions, providing guidance, and requiring accountability and transparency
  in operational practices.nnEach of Iowau2019s 15 community colleges is responsible
  for implementing and managing the 260E, 260F and 260G programs.\",\n\t\"license_title\":
